VALUES ('3760197630196', 'L\'obsession chocolat-framboise', 'Mousse de chocolat aux éclats de framboises (45%), sur un fond feuilletine au praliné (24%) et de biscuit au cacao (13%)  nappée d\'un glaçage au chocolat : Crème (crème, protéines de lait, gélifiant : carraghénanes), Chocolats (23%) (pâte de cacao, sucre, beurre de cacao, arôme, émulsifiant : lécithine de soja), Sucre, Eclats de framboises (10,9%), Praliné noisettes et amandes (9,2%) (sucre, noisettes, amandes, émulsifiant : lécithine de soja), Blanc d\'oeuf reconstitué (blanc d\'oeuf, acidifiant : acide citrique, agent moussant : E 1505), Huiles et matières grasses végétales, OEufs, Lait entier, Farine de blé, Cacao maigre en poudre (2%), Sirop de glucose, Sirop de sucre inverti, Sirop de glucose et fructose, Matière grasse de lait anhydre, Lactose, Lait écrémé en poudre, Protéines de lait, Pâte de cacao, Sel, Arôme, Colorant : extrait de paprika, Gélifiant : pectine, Poudre à lever : carbonate acide de sodium, Emulsifiants : lécithine de soja  E473, Acidifiant : acide citrique, Farine de malt d\'orge, Conservateur : sorbate de potassium. Décor (1.0%) : Chocolats (sucre, pâte de cacao, beurre de cacao, lait entier en poudre, vanille naturelle, colorants : E171, curcumine, cochenille). Contient : Gluten, OEuf, Soja, Lait, Amande et Noisette.', 'https://static.openfoodfacts.org/images/products/376/019/763/0196/front_fr.16.400.jpg', '24.3', '13.4', '33.3', '19.9', '0', '5.3', '0.13', '0.0511811023622047', '', '1');

