VALUES ('3760197636198', 'Le sublime à la mangue passion & à la vanille', 'Macarons moelleux, Mousse à la Mangue et aux Fruits de la passion et Mousse à la Vanille (99%) : crème 20%* (crème, stabilisant : carraghénanes), eau, sucre, préparation en poudre pour crème pâtissière (sucre, amidon modifié, crème en poudre, dextrose, épaississant : alginate de sodium, arôme naturel de vanille, sel, colorant : caroténoïdes), purée de mangues sucrée 8,9%* (mangues 8%*, sucre), amandes 7,1 %*, purée de fruits de la passion sucrée 5,9%* (fruits de la passion 5,3%*, sucre), beurre, lait entier, stabilisant : glycérol, farine de maïs, blanc d\'œuf en poudre (blanc d\'œuf, correcteur d\'acidité : acide citrique, agent moussant : El 505), gélatine de bœuf, arôme naturel de vanille 0,08%*, colorant : caroténdides, vanille en poudre *Pourcentages exprimés sur les Macarons moelleux et les Mousses aux fruits. Décor (1%): zestes d\'oranges, chocolat noir (pâte de cacao, sucre, beurre de cacao, vanille naturelle, colorants : El 71 , curcumine). Les informations soulignées dans la liste des ingrédients et reprises ci-dessous sont destinées aux personnes allergiques : CONTIENT : lait, fruits à coque (amandes) et œufs. PEUT CONTENIR DES TRACES DE : céréales contenant du gluten, soja et autres fruits à coque (noisettes, noix et pistaches).', 'https://static.openfoodfacts.org/images/products/376/019/763/6198/front_fr.4.400.jpg', '17', '8.2', '35', '23', '', '5.2', '0.15', '0.0590551181102362', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
